'}, {'number': 4, 'created': '2014-03-04 18:18:59.000000000', 'files': [], 'web_link': 'https://opendev.org/openstack/zaqar/commit/273db58b820d295e72d9820d18ac97d5a47dc3c7', 'message': "feat(v1.1): Implement new /health endpoint for v1.1

The new /health endpoint of v1.1 is different from the /health
of v1.0. In v1.1 /health endpoint we will return a set of KPI
(Key Performance Indicator) of the target Marconi server.

At the 1st stage, this patch implements KPI 'cpu_util' and
